ఈ పుస్తకం పేరు మానేల అబిరామం.ఈ పుస్తకం తెలుగు భాషలో రచించబడినది. యద్దనపూడి సులోచనరాణి వ్రాసిన మానేల అబిరామం పుస్తకానికి ఎమెస్కో ప్రచురణకర్త.ఈ పుస్తకం మొట్టమొదటిసారిగా సికింద్రాబాద్ లో ప్రచురించబడింది. యద్దనపూడి సులోచనరాణి రచించిన మానేల అబిరామం పుస్తకంలో 894.0 పేజీలు ఉన్నాయి.ఈ పుస్తకం యొక్క ధర 211 రూపాయిలు.

