మనోయబిరామమ్ అనే పుస్తకాన్ని యద్దనపూడి సులోచనరాణి గారు రచించారు. ఈ పుస్తకం తెలుగుభాషలోనిది. యద్దనపూడి సులోచనరాణి వ్రాసిన మనోయబిరామమ్ పుస్తకానికి ఎమెస్కో ప్రచురణకర్త.ఈ పుస్తకం మొట్టమొదటిసారిగా సికింద్రాబాద్ లో ప్రచురించబడింది. ఈ పుస్తకంలో 894.0 కలిగి ఉన్నాయి.ఈ పుస్తకం ధర 211 రూపాయిలు.

