ఈ పుస్తకం పేరు మా టివి మా పిల్లలు.ఈ పుస్తకం తెలుగు భాషలో రచించబడినది. రాధా రాధాకృష్ణ మూర్తి కాంతం నేని వ్రాసిన మా టివి మా పిల్లలు పుస్తకానికి ఎమెస్కో ప్రచురణకర్త.ఈ పుస్తకం మొట్టమొదటిసారిగా విజయవాడ లో ప్రచురించబడింది.1949 సంవత్సరంలో ఈ పుస్తకం ముద్రించబడినది. రాధా రాధాకృష్ణ మూర్తి కాంతం నేని రచించిన మా టివి మా పిల్లలు పుస్తకంలో 384.0 పేజీలు ఉన్నాయి.ఈ పుస్తకం ధర 52 రూపాయిలు.

