ఈ పుస్తకం పేరు గిరీశం ది గ్రేట్.ఈ పుస్తకం తెలుగు భాషలో రచించబడినది. కుటుంబరావు వి వ్రాసిన గిరీశం ది గ్రేట్ పుస్తకానికి ఎమెస్కో ప్రచురణకర్త.ఈ పుస్తకం మొట్టమొదటిసారిగా మచిలీపట్నం లో ప్రచురించబడింది. ఈ పుస్తకంలో 894.0 కలిగి ఉన్నాయి.ఈ పుస్తకం యొక్క ధర 184 రూపాయిలు.

