ఈ పుస్తకం పేరు జీవిత సమరంలో.ఈ పుస్తకం తెలుగు భాషలో రచించబడినది. వాసా మూర్తి వ్రాసిన జీవిత సమరంలో పుస్తకానికి ఎమెస్కో ప్రచురణకర్త.ఈ పుస్తకం మొట్టమొదటిసారిగా మచిలీపట్నం లో ప్రచురించబడింది. వాసా మూర్తి రచించిన జీవిత సమరంలో పుస్తకంలో 894.0 పేజీలు ఉన్నాయి.ఈ పుస్తకం ధర 192 రూపాయిలు.

