ఈ పుస్తకం పేరు ఒక విజేత ఆత్మకథ.ఈ పుస్తకం తెలుగు భాషలో రచించబడినది. అబ్దుల్ కలాం వ్రాసిన ఒక విజేత ఆత్మకథ పుస్తకానికి ఎమెస్కో ప్రచురణకర్త.విజయవాడ లో ఈ పుస్తకం మొదటి సారిగా ప్రచురించబడింది . అబ్దుల్ కలాం రచించిన ఒక విజేత ఆత్మకథ పుస్తకంలో 925.0 పేజీలు ఉన్నాయి.ఈ పుస్తకం యొక్క ధర 195 రూపాయిలు.

