ఈ పుస్తకం పేరు యముడి ముందు చలం.ఈ పుస్తకం తెలుగు భాషలో రచించబడినది. చలం వ్రాసిన యముడి ముందు చలం పుస్తకానికి ఎమెస్కో ప్రచురణకర్త.మచిలీపట్నం లో ఈ పుస్తకం మొదటి సారిగా ప్రచురించబడింది . చలం రచించిన యముడి ముందు చలం పుస్తకంలో 894.0 పేజీలు ఉన్నాయి.ఈ పుస్తకం ధర 197 రూపాయిలు.

