ఈ పుస్తకం పేరు జీవన పల్లవి.ఈ పుస్తకం తెలుగు భాషలో రచించబడినది. విజయలక్ష్మి అంగార వ్రాసిన జీవన పల్లవి పుస్తకానికి ఎమెస్కో ప్రచురణకర్త.మచిలీపట్నం లో ఈ పుస్తకం మొదటి సారిగా ప్రచురించబడింది . విజయలక్ష్మి అంగార రచించిన జీవన పల్లవి పుస్తకంలో 894.0 పేజీలు ఉన్నాయి.ఈ పుస్తకం ధర 112 రూపాయిలు.

{{Infobox book | name = కోరికల అలలు | author = లక్ష్మీకుమారి ఎ | language = తెలుగు | publisher = ఎమెస్కో | publisher2 = మచిలీపట్నం | pub_date = nan
}}
ఈ పుస్తకం పేరు కోరికల అలలు.ఈ పుస్తకం తెలుగు భాషలో రచించబడినది. లక్ష్మీకుమారి ఎ వ్రాసిన కోరికల అలలు పుస్తకానికి ఎమెస్కో ప్రచురణకర్త.మచిలీపట్నం లో ఈ పుస్తకం మొదటి సారిగా ప్రచురించబడింది . లక్ష్మీకుమారి ఎ రచించిన కోరికల అలలు పుస్తకంలో 894.0 పేజీలు ఉన్నాయి.ఈ పుస్తకం ధర 112 రూపాయిలు.

{{Infobox book | name = విధి ఎదురైతే | author = సాయి యర్రంశెట్టి | language = తెలుగు | publisher = ఎమెస్కో | publisher2 = మచిలీపట్నం | pub_date = nan
}}
విధి ఎదురైతే అనే పుస్తకాన్ని సాయి యర్రంశెట్టి గారు రచించారు. ఈ పుస్తకం తెలుగుభాషలోనిది. సాయి యర్రంశెట్టి వ్రాసిన విధి ఎదురైతే పుస్తకానికి ఎమెస్కో ప్రచురణకర్త.ఈ పుస్తకం మొట్టమొదటిసారిగా మచిలీపట్నం లో ప్రచురించబడింది. ఈ పుస్తకంలో 894.0 కలిగి ఉన్నాయి.ఈ పుస్తకం ధర 118 రూపాయిలు.

{{Infobox book | name = నవత మానవత | author = గంగాధరరావు కొర్రపాటి డా | language = తెలుగు | publisher = ఎమెస్కో | publisher2 = మచిలీపట్నం | pub_date = nan
