ఈ పుస్తకం పేరు నవత మానవత.ఈ పుస్తకం తెలుగు భాషలో రచించబడినది. గంగాధరరావు కొర్రపాటి డా వ్రాసిన నవత మానవత పుస్తకానికి ఎమెస్కో ప్రచురణకర్త.మచిలీపట్నం లో ఈ పుస్తకం మొదటి సారిగా ప్రచురించబడింది . గంగాధరరావు కొర్రపాటి డా రచించిన నవత మానవత పుస్తకంలో 894.0 పేజీలు ఉన్నాయి.ఈ పుస్తకం ధర 120 రూపాయిలు.

{{Infobox book | name = బ్రెయిన్ డ్రెయిన్ | author = కవన శర్మ | language = తెలుగు | publisher = ఎమెస్కో | publisher2 = మచిలీపట్నం | pub_date = nan
