ఈ పుస్తకం పేరు బ్రెయిన్ డ్రెయిన్.ఈ పుస్తకం తెలుగు భాషలో రచించబడినది. కవన శర్మ వ్రాసిన బ్రెయిన్ డ్రెయిన్ పుస్తకానికి ఎమెస్కో ప్రచురణకర్త.ఈ పుస్తకం మొట్టమొదటిసారిగా మచిలీపట్నం లో ప్రచురించబడింది. ఈ పుస్తకంలో 894.0 కలిగి ఉన్నాయి.ఈ పుస్తకం యొక్క ధర 120 రూపాయిలు.

