ఈ పుస్తకం పేరు జీవితం గెలుపు నీదే.ఈ పుస్తకం తెలుగు భాషలో రచించబడినది. శారదా అశోకవర్ధన్ వ్రాసిన జీవితం గెలుపు నీదే పుస్తకానికి ఎమెస్కో ప్రచురణకర్త.మచిలీపట్నం లో ఈ పుస్తకం మొదటి సారిగా ప్రచురించబడింది . ఈ పుస్తకంలో 894.0 కలిగి ఉన్నాయి.ఈ పుస్తకం యొక్క ధర 120 రూపాయిలు.
